import react, { useEffect, useState } from "react";
import { NavLink, useNavigate } from "react-router-dom";
import Header from "../components/header";
import Footer from "../components/footer";

const Home = () => {
    return (
        <>
            <header>
                <Header />
            </header>
            <div id="main" > HOME </div>
            <footer>
                <Footer />
            </footer>
        </>
    );
}

export default Home;
